import './App.css';

function App() {
  return (
    <div className="App-header">
      <Formulario />
    </div>
  );
}

function Formulario(){
  return (
    <div className='form'>
        <label>
        Login:
         <input name="myInput" className='dadosLogin' defaultValue="1000" />
        </label>
        <label>
        Senha:
         <input name="mySenha" className='dadosLogin' defaultValue="147258" />
        </label>
        <button>
          Login
        </button>

    </div>
  );
}

export default App;
